- {"dt": "2022-06-09T11:10:01.259026", "lvl": "target", "msg": "fdt move   <fdt> <newaddr> <length> - Copy the fdt to <addr> and make it active"}
- {"dt": "2022-06-09T11:10:01.259109", "lvl": "target", "msg": "fdt resize [<extrasize>]            - Resize fdt to size + padding to 4k addr + some optional <extrasize> if needed"}
