- {"dt": "2022-06-09T11:10:01.259269", "lvl": "target", "msg": "fdt list   <path> [<prop>]          - Print one level starting at <path>"}
- {"dt": "2022-06-09T11:10:01.259352", "lvl": "target", "msg": "fdt get value <var> <path> <prop>   - Get <property> and store in <var>"}
- {"dt": "2022-06-09T11:10:01.259442", "lvl": "target", "msg": "fdt get name <var> <path> <index>   - Get name of node <index> and store in <var>"}
- {"dt": "2022-06-09T11:10:01.261731", "lvl": "target", "msg": "fdt get addr <var> <path> <prop>    - Get start address of <property> and store in <var>"}
- {"dt": "2022-06-09T11:10:01.262243", "lvl": "target", "msg": "fdt get size <var> <path> [<prop>]  - Get size of [<property>] or num nodes and store in <var>"}
- {"dt": "2022-06-09T11:10:01.262682", "lvl": "target", "msg": "fdt set    <path> <prop> [<val>]    - Set <property> [to <val>]"}
