- {"dt": "2022-06-09T11:10:01.263609", "lvl": "target", "msg": "fdt rm     <path> [<prop>]          - Delete the node or <property>"}
- {"dt": "2022-06-09T11:10:01.264084", "lvl": "target", "msg": "fdt header [get <var> <member>]     - Display header info"}
- {"dt": "2022-06-09T11:10:01.264547", "lvl": "target", "msg": "                                      get - get header member <member> and store it in <var>"}
