- {"dt": "2022-06-09T11:10:01.265500", "lvl": "target", "msg": "fdt memory <addr> <size>            - Add/Update memory node"}
- {"dt": "2022-06-09T11:10:01.266009", "lvl": "target", "msg": "fdt rsvmem print                    - Show current mem reserves"}
- {"dt": "2022-06-09T11:10:01.266490", "lvl": "target", "msg": "fdt rsvmem add <addr> <size>        - Add a mem reserve"}
